        color: #333;

    <script>
        const correctPasswordHash1 = "2d5c7dce69368c925d6133ee40c10d54919741a0";
        const correctPasswordHash2 = "2d5c7dce69368c925d6133ee40c10d54919741a0";  
        const cookieName = "firstPasswordLoggedIn";

        // if the first password cookie is already set
        const isFirstPasswordCookieSet = document.cookie.includes(`${cookieName}=true`);

        if (isFirstPasswordCookieSet) {
            // If the first password cookie is set, show the second password form
            document.getElementById("password-form").style.display = "none";
            document.getElementById("password-form-2").style.display = "block";
        }

        function checkPassword(passwordNumber) {
            const passwordInput = document.getElementById(`password${passwordNumber}`).value;
            const errorMessage = document.getElementById(`error-message${passwordNumber}`);

            const encoder = new TextEncoder();
            const data = encoder.encode(passwordInput);
            crypto.subtle.digest("SHA-1", data).then(function (hash) {
                var hashArray = Array.from(new Uint8Array(hash));
                var hashHex = hashArray.map(byte => byte.toString(16).padStart(2, '0')).join('');

                if (passwordNumber === 1 && hashHex === correctPasswordHash1) {
                    // Set the first password cookie to persist forever
                    document.cookie = `${cookieName}=true; expires=Fri, 31 Dec 9999 23:59:59 GMT; path=/`;

                    // Reload the page to apply the cookie and show the second password form
                    location.reload();
                } else if (passwordNumber === 2 && isFirstPasswordCookieSet) {
                    // If the first password cookie is set, check the second password
                    if (hashHex === correctPasswordHash2) {
                        // If the second password is correct, show the content
                        document.getElementById("password-form-2").style.display = "none";
                        document.getElementById("content").style.display = "block";
                        errorMessage.textContent = "";
                    } else {
                        errorMessage.textContent = "Incorrect second password. You will be redirected to Google.com.";

                        setTimeout(function () {
                            window.location.href = "https://www.google.com";
                        }, 2000);
                    }
                } else {
                    errorMessage.textContent = "Incorrect password. You will be redirected to Google.com.";

                    setTimeout(function () {
                        window.location.href = "https://www.google.com";
                    }, 2000);
                }
            });
        }
